/*
*
* KEYBOARD INIT
*
 */
const searchInput = document.getElementById('search');
const searchResults = document.getElementById('results');
const clearBtn = document.getElementById("clear");


if(clearBtn){
    clearBtn.addEventListener('click', clearSearch);
}

function clearSearch () {
    //keyboard.clearInput();
    searchInput.value = '';
    searchResults.innerHTML = '';
}


/*
*
* LIVE SEARCH
*
 */
const displayResults = async () => {
    searchInput.addEventListener('input', (e) => {

        searchResults.innerHTML = '';
        const ul = document.createElement('ul');
        ul.classList.add('students');

        let searchData = e.target.value.toLowerCase();
        const match = students.filter(post => {
            const result = post.searchString.toLowerCase().includes(searchData)
            return result;
        });
        match.forEach( student => {
            const li = document.createElement('li');
            li.classList.add('liSearch');
            const studentName = document.createElement('a');
            studentName.innerText = student.title;
            studentName.href  = student.classUrl;
            li.appendChild(studentName);
            ul.appendChild(li);
        });
        searchResults.appendChild(ul);
    });
};
displayResults();





function idleLogout() {
    var t;
    window.onload = resetTimer;
    window.onmousemove = resetTimer;
    window.onmousedown = resetTimer;  // catches touchscreen presses as well      
    window.ontouchstart = resetTimer; // catches touchscreen swipes as well      
    window.ontouchmove = resetTimer;  // required by some devices 
    window.onclick = resetTimer;      // catches touchpad clicks as well
    window.onkeydown = resetTimer;   
    window.addEventListener('scroll', resetTimer, true); // improved; see comments

    function yourFunction() {
        window.location.href = 'index.html';
    }

    function resetTimer() {
        clearTimeout(t);
        t = setTimeout(yourFunction, 30 * 1000);  // time is in milliseconds
    }
}
idleLogout();